import './index.css';
import {Line} from "react-chartjs-2";
import {Chart as ChartJS} from 'chart.js/auto'

export default function MyChart({chartData}) {
  return (
    <div className="chart"  style={{ width: 300 }}>
      { <Line data={chartData} /*options={}*/ /> }
    </div>
  );
}
